import React, {Component} from 'react'
import './footer.css'

export default class FooterComponent extends Component {

    constructor(props) { super(props) }

    render() {
        return (
            <div className="footer__container">
                <div className="footer__contact-container">
                    <h1>Contact</h1>
                </div>
                <div>
                    <h1>Links</h1>
                </div>
            </div>
        )
    }
}
